    return (
        <View>
            <Title title='Code de verification'></Title>
            <GlobalButton
              onPress={() => setOpen(!Open)}
              title='Hide Modal'
            >
          </GlobalButton>
          <Text>Rest Password</Text>
          <TextInput
            onChangeText={setCode}
